import React from "react";
import ReactDOMClient from "react-dom/client";
import "./css/main.css";

class Prog extends React.Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    return (
      <div>
        <h2>List work</h2>
        <form>
          <input />
        </form>
        <br />
        <br />
        <li></li>
      </div>
    );
  }
}

const link = ReactDOMClient.createRoot(document.getElementById("test"));
link.render(<Prog />);

export default Prog;
